bubble_chips.description:
Make your subbuttons look more like <a href="https://github.com/piitaya/lovelace-mushroom/blob/main/docs/cards/chips.md">Mushroom Chips</a>
<br />

<b>Example on how to add a line break:</b><br />
<pre><code class="language-javascript">
  const container = card.querySelector(".bubble-sub-button-container");
  if (!container) return;

  const targetElement = container.querySelector('.bubble-sub-button-5');
  if (!targetElement) return;

  // Check if a break element already exists before the target
  if (targetElement.previousElementSibling?.classList.contains("break")) return;

  // Create the break element
  const breakEl = document.createElement("div");
  breakEl.classList.add("break");

  // Insert before the target element
  container.insertBefore(breakEl, targetElement);
</code></pre>
<br />

<b>You might also want to add the following to reduce the top margin:</b><br />
<pre><code class="language-css">
.bubble-wrapper {
  height: 75%
}
</code></pre>

