/* Remove background so the subbuttons look more like smaller regular buttons similar to Mushroom Chips */
ha-card { --bubble-main-background-color: transparent}

/* Wrap subbuttons like Mushroom Chips */
.bubble-sub-button-container,
.large .bubble-sub-button-container {
    display: flex;
    flex-flow: wrap;
    justify-content: ${this.config.bubble_chips?.['justify-content'] || 'flex-end'};
    gap: ${this.config.bubble_chips?.gap || '8'}px;
  }

/* Allow icons using drop-shadow to not get cut off by their container. Useful for glow effects. */
.bubble-button-card-container,
.bubble-button-card-container .bubble-container,
.bubble-button-card-container .bubble-container .button-container {
  overflow: visible !important;
}

/* Add a class to break rows */
.break {
  flex-basis: 100%;
  height: 0; 
  margin-top: this.config.bubble_chips?.gap * - 1 || '-8px'; /* Cancels out one extra gap */
}

/* Auto adjust the rows of the card to fit the rows of subbutons */
${(() => {
  const container = card.querySelector(".large .bubble-sub-button-container");
  if (!container) return;

  // Filter out .break elements before calculating rows
  const elements = Array.from(container.children).filter(el => !el.classList.contains("break"));
  const uniqueRows = new Set(elements.map(el => el.offsetTop));
  const calculatedRowSize = uniqueRows.size;

  // Get the current --row-size value, defaulting to -1 if it cannot be parsed
  const currentRowSize = parseInt(getComputedStyle(card).getPropertyValue("--row-size")) || -1;

  // Only update if the value has changed
  if (currentRowSize !== calculatedRowSize) {
      card.style.setProperty("--row-size", calculatedRowSize);

      this.setConfig({
          ...this.config,
          grid_options: {
              ...this.config.grid_options,
              rows: calculatedRowSize
          }
      });

      this.requestUpdate?.();
  }
})()}

progress_border.code:
${(() => {
    const { progress_border: config } = this.config;
    const element = card.querySelector('.bubble-icon-container');

    if (!config || !config.entity) {
        return; 
    }

    const entity = hass.states[config.entity];
    if (!entity) {
        return; 
    }

    let progressValue;
    if (config.attribute) {
        progressValue = parseFloat(entity.attributes[config.attribute]);
    } else {
        progressValue = parseFloat(entity.state);
    }
    if (isNaN(progressValue) || progressValue < 0 || progressValue > 100) {
        progressValue = 0;
    }

    const color = config.color;
    let colorVariable;
    if (color) {
        colorVariable = `var(--${color}-color)`;
    } else {
        colorVariable = `var(--primary-color)`; 
    }     

    const backcolor = config.backcolor; 
    let backColorVariable;
    if (backcolor) {
        backColorVariable = `var(--${backcolor}-color)`;
    } else {
        backColorVariable = `var(--dark-grey-color)`;
    }

    const bubbleBorderRadius = getComputedStyle(element).getPropertyValue('--bubble-icon-border-radius');
    if (bubbleBorderRadius && bubbleBorderRadius.trim() !== '') {
        element.classList.add('has-bubble-border-radius');
    } else {
        element.classList.remove('has-bubble-border-radius');
    }

    if (element) {
        element.style.background = `radial-gradient(${backColorVariable} 60%, transparent 0%), conic-gradient(${colorVariable} ${progressValue}% 0%, ${backColorVariable} 0% 100%)`;
    }
})()}
.bubble-icon-container.has-bubble-border-radius:before {
    position: absolute;
    content: "";
    margin-top: 2px !important;
    margin-left: 2px !important;
    margin-top: 2px !important;
    margin-bottom: 2px !important;
    height: calc(100% - 4px) !important;
    width: calc(100% - 4px) !important;
    border-radius: calc(var(--bubble-icon-border-radius) - 2px) !important;
    background: var(--${this.config.progress_border?.backcolor ?? 'card-background'}-color) !important;
    opacity: 1 !important;
}

