rmn_conditional_background_color.code:
${(() => {
  // Retrieve the configuration or use an empty array by default
  const config = this.config.rmn_conditional_background_color || [];

  // Set the optional opacity for the card background
  var element = card.querySelector(".bubble-background");
  const opacity = config.opacity || 100;
  element.style.setProperty("opacity", `${opacity}%`);

  for (const [key, value] of Object.entries(config)) {
    // Skip irrelevant config entries
    if (!key.startsWith("background_")) {
      continue;
    }

    const conditions = value?.conditions;
    if (!conditions || checkConditionsMet([].concat(conditions), hass)) {
      const colorMode = value?.color_mode;
      if (!colorMode) {
        continue;
      }

      // Set the background color based on the selected color mode
      var color = "transparent"; // Default color

      if (colorMode === "preset") {
        color = `var(--${value?.color_preset || "none"}-color)`;
      } else if (colorMode === "wheel") {
        color = value?.color_wheel || "transparent";
      } else if (colorMode === "variable") {
        var colorVar = value?.color_variable || "--card-background-color";
        color = `rgb(var(${colorVar}))`;
      }

      element.style.setProperty("background-color", color);
    }
  }
})()}

