.spin {
  animation: slow-rotate 2s linear infinite;
}

.sound {
  animation: sound 0.8s linear infinite;
}


.roam {
  animation: roam 10s linear infinite;
}

.bounce {
  animation: bounce 2s infinite 2s;
}


@keyframes slow-rotate {
  0% { transform: rotate(0deg); }
  100% { transform: rotate(360deg); }
}

@keyframes sound {
  0% { transform: scale(1); }
  50% { transform: scale(1.10); }
  100% { transform: scale(1); }
}

@keyframes roam {
  0% { transform: translate(0px, 5px) rotate(0deg); }
  25% { transform: translate(-5px, 0px) rotate(-45deg); }
  50% { transform: translate(0px, -5px) rotate(0deg); }
  75% { transform: translate(5px, 0px) rotate(45deg); }
  100% { transform: translate(0px, 5px) rotate(0deg); }
}

@keyframes bounce {
  0%, 20%, 50%, 80%, 100% {
    transform: translateY(0);
    opacity: 1;
  }
  40% { transform: translateY(-8px); }
  60% { transform: translateY(-5px); }
}

${(() => {
    const config = this.config.subbutton_animations || {};

    const hasAnimation = (subbuttonConfig) => {
        if(subbuttonConfig?.animation) {
          return true;
        } else {
          return false;
        }
    };

    const addAnimation = (containerSelector, subbuttonConfig) => {
      if(!hasAnimation) {
        return;
      }

      const subbuttonIcon = card.querySelector(containerSelector);
      if(!subbuttonConfig?.condition || (subbuttonConfig?.condition && checkConditionsMet([].concat(subbuttonConfig.condition), hass))) {
        subbuttonIcon.classList.add(subbuttonConfig.animation);
      } else {
        subbuttonIcon.classList.remove(subbuttonConfig.animation);
      }
    };

    Object.values(config).forEach((c, index) => {
      let subbuttonNumber = Number(Object.keys(config)[index].replace("subbutton", ""))
      addAnimation(`.bubble-sub-button-${subbuttonNumber} .bubble-sub-button-icon`, c);
    });
})()}

humidity_colouring.code:
${(() => {
  const humiditySensor = hass?.states[this.config?.humidity_colouring?.humidity_sensor];
  const humidity = parseFloat(humiditySensor?.state || 0);
  const elements = this.config?.humidity_colouring?.elements || {};

  let color;
  let icon = 'mdi:water-percent';

  // Determine the colour and icon based on humidity
  if (humidity < 30) {
    color = 'rgba(210,180,140,0.8)'; // Light Brown (very dry)
    icon = 'mdi:water-percent-alert';
  } else if (humidity < 40) {
    color = 'rgba(222,184,135,0.8)'; // Burlywood (dry)
  } else if (humidity <= 60) {
    color = 'rgba(152,251,152,0.8)'; // Pale Green (optimal)
  } else if (humidity < 70) {
    color = 'rgba(173,216,230,0.8)'; // Light Blue (humid)
  } else {
    color = 'rgba(135,206,250,0.8)'; // Light Sky Blue (very humid)
    icon = 'mdi:water-percent-alert';
  }

  // Apply colour and icon to selected sub-buttons
  if (elements.sub_buttons) {
    const subButtons = Array.isArray(elements.sub_buttons) ? elements.sub_buttons : [];
    subButtons.forEach(num => {
      if (num >= 1 && num <= 6) {
        const subButton = card?.querySelector(`.bubble-sub-button-${num}`);
        if (subButton) {
          const iconElement = subButton.querySelector('ha-icon');
          if (iconElement) {
            iconElement.style.color = color;
            iconElement.setAttribute('icon', icon);
          }
        }
      }
    });
  }

  // Apply colour to state display if enabled
  if (elements.state_display) {
    const stateElement = card?.querySelector('.bubble-state.state.display-state');
    if (stateElement) {
      stateElement.style.color = color;
    }
  }
  return '';
})()}

